// import React from "react";

function App(){
    return(
        <div>
            <h1>Rocky Bhai</h1>
            {/* <p>Jackson  an the way</p> */}
            <Pass/>
        </div>
        
    )
}

function Pass(){
    return(
        <div>
            <h1>Johnny </h1>
        <Main/>
        </div>
    )
}

function Main(){
    return(
        <div>
            <h1>Rolex </h1>
            <Jack/>
        </div>
    )
}

function Jack(){
    return(
        <div>
            <h1>Jacky</h1>
        </div>
    )
}

function King(){
    return(
        <div>
            <h1>Dilli vs Rolex</h1>
        </div>
    )
}

function Done(){
    return(
        <div>
            <h1>Antony Das</h1>
        </div>
    )
}

export default App;
